import React from "react";
import Navbar from "./navbar";

function App() {
  const [allData, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api", {
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }
    })
      .then((res) => res.json())
      .then((data) => setData(data["docs"]));
  }, []);

  console.log("data: " + allData);

  return (
    <div className="App">
    <Navbar></Navbar>
    </div>
  );
}

export default App;
